exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.yingzhicy.com/${bid}/${page}/`,"dl.panel-chapterlist",{...options,clientOptions,pageSize:20,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/\/(\d+)\/"/)?.intValue(),idRegex:/\/(?<id>[a-z\d]+)\.html/})};